from tkinter import *
from tkinter import ttk

root = Tk()
root.title("Make Ryan happy")
root.geometry("800x900")
root.config(background="#4D4D4D")
style = ttk.Style()

    
flag = 0
text = [
    """



























































































































































































""",
    """



























































































































































































""",
]

label = Label(text=text[flag], font=("TkFixedFont", 2), background="#ff9494")
label.pack()

style.configure("My1.TButton", background="red")
style.configure("My2.TButton", background="green")


def clb():
    global flag
    flag = (flag + 1) % 2
    label.config(text=text[flag], background= "#ff9494" if flag == 0 else "#c5f5be")
    btn.config(text="скидка" if flag == 0 else "капитализм")

    if flag == 0:
        btn.config(style="My2.TButton")
    else:
        btn.config(style="My1.TButton")

btn = ttk.Button(text="скидка", command=clb, style="My2.TButton")
btn.pack()

root.mainloop()
